sys_variable_value.value:
(function execute(inputs, outputs) {
    var successCodes = ['200', '202', '201'];
    var response = JSON.parse(inputs.response_body);
    var arrayUtil = new global.ArrayUtil();
    if (arrayUtil.contains(successCodes, inputs.status)) {
        outputs.status = 'Success';
        if (response) {
            outputs.job = response;
            if (JSON.stringify(response.properties.parameters) != '{}') {
                var keys = Object.keys(response.properties.parameters);
                var params = [];
                for (var i = 0; i < keys.length; i++) {
                    var param = {};
                    param.name = keys[i];
                    param.value = response.properties.parameters[keys[i]];
                    params.push(param);
                }
                outputs.job.properties.parameters = params;
            }
        }
    } else {
        outputs.status = 'Error';
        if (response.message)
            outputs.error_message = response.message;
        else
            outputs.error_message = response.error.message;
    }
})(inputs, outputs);

